public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (obj instanceof NodeAttributeInfo) {
    NodeAttributeInfo other = (NodeAttributeInfo) obj;
    getAttributeKey().equals(other.getAttributeKey());
    return true;
  }
  return false;
}
